const guardarEnJSON = async (pdfUri) => {
    const subdirectorio = "assets/data/comprobantes/";
    const jsonUri = FileSystem.documentDirectory + subdirectorio + "compobantesDePago.json";

    let comprobantes = [];
    try {
      const jsonString = await FileSystem.readAsStringAsync(jsonUri);
      comprobantes = JSON.parse(jsonString);
    } catch (error) {
      console.log("No se encontr√≥ archivo json para guardar.");
    }
    await FileSystem.makeDirectoryAsync(
      FileSystem.documentDirectory + subdirectorio,
      { intermediates: true }
    );
    await FileSystem.writeAsStringAsync(jsonUri, JSON.stringify(comprobantes));
  };

  let generatePdf = async () => {
    const file = await printToFileAsync({
      html: html,
      base64: true,
      width: 595,
      height: 842,
    });

    console.log(file)

    await guardarEnJSON(file.uri);
  };